            Buses = AllBuses.Except(BusesRemovedBySyaSyuRen).Where(b => selectSyaSyuRen.Contains(b.SyaSyuRen)).ToList();

        }
        catch (Exception ex)
        {
            CancelRemoveCar();
            throw;
        }
